const withErrorHandler = (WrapedComponent, axios) => {
    return (props) => {
        return (
            <Aux>
                <Modal show>Something didn't work</Modal>
            <WrapedComponent {...props}/>
            </Aux>
        );
    }
}

export default withErrorHandler;
